import{_ as e,o as t,c as o,O as s}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 55.1-1427 How person entitled to lands may be restored to his possession.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/55.1-1427.md","filePath":"vacode/55.1-1427.md"}'),a={name:"vacode/55.1-1427.md"},r=s('<h1 id="§-55-1-1427-how-person-entitled-to-lands-may-be-restored-to-his-possession" tabindex="-1">§ 55.1-1427 How person entitled to lands may be restored to his possession. <a class="header-anchor" href="#§-55-1-1427-how-person-entitled-to-lands-may-be-restored-to-his-possession" aria-label="Permalink to &quot;§ 55.1-1427 How person entitled to lands may be restored to his possession.&quot;">​</a></h1><p>If the person entitled to lands subject to a proceeding filed pursuant to § <a href="/vacode/55.1-1419/">55.1-1419</a> at the time of reentry made, or having claim to such lands, does not pay the rent and all arrears owed, with interest and all reasonable expenses incurred about such reentry, within one year from the first day of publication pursuant to § <a href="/vacode/55.1-1425/">55.1-1425</a>, he shall be forever barred from all right to the lands. If any party who has the right of possession pays the rent and arrears owed, with interest and expenses pursuant to this section, to the party making reentry, within the required time, he shall be reinstated in his possession to hold as if the reentry had not been made.</p><p>Code 1919, § 5538; Code 1950, § 55-247; 2019, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0712" target="_blank" rel="noreferrer">712</a>.</p>',3),n=[r];function i(d,h,l,p,c,_){return t(),o("div",null,n)}const u=e(a,[["render",i]]);export{m as __pageData,u as default};
